import React from "react";
import ExpenseItem from "./ExpenseItem";


const ExpenseList=(props)=>{
    let expenseContent=<p className="no-expense_found">No expenses found</p>;

    if(props.items.length > 0) {
        expenseContent = filteredExpenses.map((expense) => (        //The Array.map() method creates a new array from the results of calling a function for every element.
            <ExpenseItem                                            //const numbers = [4, 9, 16, 25];
            key={expense.id}                                        //document.getElementById("demo").innerHTML = numbers.map(Math.sqrt);  o/p : 2,3,4,5 
                title={expense.title}
                amnt={expense.amount}
                date={expense.date}
            />
        ))
    }



    return (
        {expenseContent}
    )
}

export default ExpenseList;
